import React from 'react'
import Login from "./Login";
import Register from "./Register";
import FundraisingProjects from "./FundraisingProject/FundraisingProjects";
import './App.css';
import { BrowserRouter, Route, Switch, Link } from "react-router-dom";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';


async function allProjects() {
    return await fetch(`http://localhost:18080/fundraising-projects/all`, {
        method: 'GET',
        headers: new Headers({
            "Authorization": sessionStorage.jwtToken
        })
    }).then(response => response.json());
}

function App() {
    return (
        <BrowserRouter>
            <div className="App">
                <nav className="navbar navbar-expand-lg navbar-light fixed-top">
                    <div className="container">
                        <Link className="navbar-brand" to={"/sign-in"}>ConceptFunder</Link>
                        <div className="collapse navbar-collapse" id="navbarTogglerDemo02">
                            <ul className="navbar-nav ml-auto">
                                <li className="nav-item">
                                    <Link className="nav-link" to={"/fundraising-projects"}>Fundraising Projects</Link>
                                </li>
                                <li className="nav-item">
                                    <Link className="nav-link" to={"/sign-in"}>Login</Link>
                                </li>
                                <li className="nav-item">
                                    <Link className="nav-link" to={"/register"}>Sign up</Link>
                                </li>
                            </ul>
                        </div>
                    </div>
                </nav>

                <div className="auth-wrapper">
                    <div className="auth-inner">
                        <Switch>
                            <Route path="/sign-in" component={Login} />
                            <Route path="/register" component={Register} />
                            <Route path="/fundraising-projects" component={<FundraisingProjects projects={allProjects()}/>}></Route>
                        </Switch>
                    </div>
                </div>
            </div>
        </BrowserRouter>
    );
}

export default App
